  \tANNUAL_REVENUE\n) as\nselect m.surf_id,m.cm_override_name,m.create_date,m.cm_override_duns_number,m.party_type,m.cm_override_empl_cnt,m.ACCT_INDUSTRY_SEGMENT,m.company_hierarchy_level,m.cm_override_segment,m.cm_override_annual_revenue,m.total_acv,m.addr_ln1,m.city,m.state_nm,m.country_nm,m.country_cd,m.cmid,m.company_cmid,m.gp_nmbr,m.gp_override_name,m.dp_nmbr,m.dp_override_name,m.pub_sec_company_cd,m.partner_status,m.duplicate_rsn_cd,m.annual_revenue\n\
  from rds.mdm.v_mdm_company m\nwhere m.company_hierarchy_level in ('random','random')\n\
  AND m.company_active_flag = 'random';"
